import { Button } from "antd";
import React from "react";
import styled from "styled-components";
import img1 from "../assets/homepage_1.png";
import img2 from "../assets/homepage_2.png";
import img3 from "../assets/homepage_3.png";

const HomeWrapper = styled.div`
  width: 940px;
  margin: 0 auto;
`;

const RowWrapper = styled.div``;

export default function Home() {
  return (
    <HomeWrapper>
      <RowWrapper>
        <img src={img1} />
        <div>
          <h1> Ví đồng tiền điện tử & Công nghệ Blockchain </h1>
          <h2> Bắt đầu tạo ví ngay bây giờ để sở hữu những ưu đãi mới nhất </h2>
          <Button>Tạo ví mới ngay</Button>
        </div>
      </RowWrapper>
    </HomeWrapper>
  );
}
